import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { PawPrint, Calendar, User, LogOut, Menu } from 'lucide-react';
import { useAuth } from '../../context/AuthContext';

const Header = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const [mobileMenuOpen, setMobileMenuOpen] = React.useState(false);

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <header className="bg-white shadow-md">
      <div className="max-w-7xl mx-auto px-4 py-4">
        <div className="flex justify-between items-center">
          {/* Logo */}
          <Link to="/" className="flex items-center space-x-2">
            <PawPrint className="w-8 h-8 text-indigo-600" />
            <span className="text-2xl font-bold text-gray-800">PetBooking</span>
          </Link>

          {/* Desktop Navigation */}
          <nav className="hidden md:flex items-center space-x-6">
            <Link to="/booking" className="flex items-center space-x-1 text-gray-700 hover:text-indigo-600 transition">
              <Calendar className="w-5 h-5" />
              <span>Κράτηση</span>
            </Link>

            {user ? (
              <>
                <Link to="/my-bookings" className="text-gray-700 hover:text-indigo-600 transition">
                  Οι Κρατήσεις μου
                </Link>
                <Link to="/profile" className="flex items-center space-x-1 text-gray-700 hover:text-indigo-600 transition">
                  <User className="w-5 h-5" />
                  <span>{user.name}</span>
                </Link>
                <button
                  onClick={handleLogout}
                  className="flex items-center space-x-1 text-gray-700 hover:text-red-600 transition"
                >
                  <LogOut className="w-5 h-5" />
                  <span>Έξοδος</span>
                </button>
              </>
            ) : (
              <>
                <Link to="/login" className="text-gray-700 hover:text-indigo-600 transition">
                  Σύνδεση
                </Link>
                <Link to="/register" className="bg-indigo-600 text-white px-4 py-2 rounded-lg hover:bg-indigo-700 transition">
                  Εγγραφή
                </Link>
              </>
            )}
          </nav>

          {/* Mobile Menu Button */}
          <button
            onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
            className="md:hidden text-gray-700"
          >
            <Menu className="w-6 h-6" />
          </button>
        </div>

        {/* Mobile Navigation */}
        {mobileMenuOpen && (
          <nav className="md:hidden mt-4 space-y-3">
            <Link to="/booking" className="block text-gray-700 hover:text-indigo-600">
              Κράτηση
            </Link>
            {user ? (
              <>
                <Link to="/my-bookings" className="block text-gray-700 hover:text-indigo-600">
                  Οι Κρατήσεις μου
                </Link>
                <Link to="/profile" className="block text-gray-700 hover:text-indigo-600">
                  Προφίλ
                </Link>
                <button onClick={handleLogout} className="block text-red-600">
                  Έξοδος
                </button>
              </>
            ) : (
              <>
                <Link to="/login" className="block text-gray-700 hover:text-indigo-600">
                  Σύνδεση
                </Link>
                <Link to="/register" className="block text-indigo-600 font-semibold">
                  Εγγραφή
                </Link>
              </>
            )}
          </nav>
        )}
      </div>
    </header>
  );
};

export default Header;
